(10, 'password_reset', 'Reset Password', 'Reset Password Notification', '<p class=\"MsoNormal\"><strong><span lang=\"EN-US\" style=\"font-size: 20.0pt; line-height: 107%;\">Reset Password Notification</span></strong></p>\r\n<p class=\"MsoNormal\"><strong><img src=\"https://skyforecasting.net/help-center/images/logo-light.png\" alt=\"Sky Forecasting\" width=\"500\" height=\"107\"></strong></p>\r\n<h2><span class=\"text-small\" style=\"color: hsl(0,0%,0%);\"><strong>Hello!</strong></span></h2>\r\n<p>You are receiving this email because we received a password reset request for your account, please click on the link below to reset your password.</p>\r\n<p><a href=\"{{link}}\">{{link}}</a></p>\r\n<p>This password reset link will expire in <strong>15</strong> minutes. If you did not request a password reset, no further action is required.</p>\r\n<p><strong>Best Regards</strong></p>\r\n<p><span style=\"color: hsl(240,75%,60%);\"><strong>Sky Forecasting Team</strong></span></p>\r\n<p>&nbsp;<a href=\"https://www.instagram.com/skyforecasting/\"><img class=\"image_resized\" style=\"width: 4.97%;\" src=\"https://skyforecasting.net/help-center/media/images/ofBRYlvT1cu30VS_1700260141.png\"></a> <a href=\"https://twitter.com/skyforecasting\"><img class=\"image_resized\" style=\"width: 4.9%;\" src=\"https://skyforecasting.net/help-center/media/images/lSr0pUYldGRD46h_1700260215.png\"></a> <img class=\"image_resized\" style=\"width: 5.03%;\" src=\"https://skyforecasting.net/help-center/media/images/pk8iEq2c7f3mICO_1700260869.png\"> <img class=\"image_resized\" style=\"width: 5.05%;\" src=\"https://skyforecasting.net/help-center/media/images/krFVCzRVOornVih_1700260896.png\"></p>\r\n<p><span class=\"text-tiny\">You received this email because you subscribed to our list.</span><br><span class=\"text-tiny\" style=\"color: hsl(0,75%,60%);\">&nbsp;</span><a href=\"https://skyforecasting.net/unsubscribepage/unsubscribe.html\"><span class=\"text-tiny\" style=\"color: hsl(0,75%,60%);\">Unsubscribe</span></a><span class=\"text-tiny\"> from future emails or update email preferences.</span><br><span class=\"text-tiny\">&copy; 2023 Sky Forecasting. All Rights Reserved.</span></p>\r\n<p>&nbsp;</p>\r\n<p><br>&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>', '{\n\"link\":\"Password reset link\",\n\"expiry_time\":\"Link expiry time\",\n\"website_name\":\"Your website name\"\n}', 1),
(11, 'email_verification', 'Email Verification', 'Verify Email Address', '<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><strong><span lang=\"EN-US\" style=\"font-size: 22.0pt; font-family: \'Times New Roman\',serif; mso-fareast-font-family: \'Times New Roman\';\">Verify Email Address</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: normal;\"><strong><img src=\"https://skyforecasting.net/help-center/images/logo-light.png\" alt=\"Sky Foreecasting\" width=\"500\" height=\"107\"></strong></p>\r\n<h2>Hello!</h2>\r\n<p>Please click on the link below to verify your email address.</p>\r\n<p><a href=\"{{link}}\">{{link}}</a></p>\r\n<p>If you did not create an account, no further action is required.</p>\r\n<p><br><strong>Best Regards</strong></p>\r\n<p><span style=\"color: hsl(240,75%,60%);\"><strong>Sky Forecasting Team</strong></span></p>\r\n<p>&nbsp;<a href=\"https://www.instagram.com/skyforecasting/\"><img class=\"image_resized\" style=\"width: 4.97%;\" src=\"https://skyforecasting.net/help-center/media/images/ofBRYlvT1cu30VS_1700260141.png\"></a> <a href=\"https://twitter.com/skyforecasting\"><img class=\"image_resized\" style=\"width: 4.9%;\" src=\"https://skyforecasting.net/help-center/media/images/lSr0pUYldGRD46h_1700260215.png\"></a> <a href=\"https://www.facebook.com/profile.php?id=61553152322786\"><img class=\"image_resized\" style=\"width: 5.03%;\" src=\"https://skyforecasting.net/help-center/media/images/pk8iEq2c7f3mICO_1700260869.png\"></a> <a href=\"https://www.youtube.com/channel/UCscdHPJ4f79CAmiO2f9gJoA\"><img class=\"image_resized\" style=\"width: 5.05%;\" src=\"https://skyforecasting.net/help-center/media/images/krFVCzRVOornVih_1700260896.png\"></a></p>\r\n<p><span class=\"text-tiny\">You received this email because you subscribed to our list.</span><br><span class=\"text-tiny\" style=\"color: hsl(0,75%,60%);\">&nbsp;</span